when DATEDIFF (Current_Date(),Date_registration)<=3 AND  Date_analise_beg<>'0000-00-00' then 'На очереди'
when DATEDIFF (Current_Date(),Date_registration)>3 and Date_analise_beg= '0000-00-00' then 'Установите планируемую дату начала анализа' 

when Current_Date()<Date_analise_beg and Date_analise_end ='0000-00-00'  then 'На очереди'
when Current_Date()<Date_analise_beg and Date_analise_end <>'0000-00-00'  then 'На очереди'
when DateDiff(Current_Date(),Date_analise_beg)<=3 and Date_analise_end='0000-00-00' then 'Определение планируемой даты окончания анализа '
when datediff(Current_Date(),Date_analise_beg)>3 and Date_analise_end='0000-00-00' then 'Установите планируемую дату окончания анализа' 
when Current_Date()>Date_analise_beg and Current_Date()<Date_analise_end then 'Анализ'
when  current_Date() >Date_analise_end and Date_test_beg='0000-00-00' then ' Установите дату передачи на тестирование'
 when Date_test_beg <>'0000-00-00'and current_Date()<Date_test_beg then 'Разработка'
when Current_Date()>Date_test_beg and Date_test_end ='0000-00-00'then 'Установите дату окончаия тестирования'
when Current_Date()<=Date_test_end and Date_test_end<>'0000-00-00' then 'Тестирование' 
when Date_test_end>Current_date() and date_expluatation='0000-00-00' then 'Определите дату передачи в эксплуатацию'
else '  '
end ) where idApp <>0
;
